# --- Helper Functions ---

def get_timestamp() -> str:
    """Generates a timestamp string in YYYYMMDD_HHMMSS format."""
    return datetime.datetime.now().strftime('%Y%m%d_%H%M%S')

# <<< Reverted to using tkinter.filedialog >>>
def select_folder(title: str) -> Optional[str]:
    """Opens a GUI dialog to select a folder and returns the path."""
    print(f"\nA folder selection window should open. Please select the folder for: '{title}'")
    # Create a hidden root window
    root = tk.Tk()
    root.withdraw()
    # Make sure the dialog appears on top (may help on some systems)
    root.attributes('-topmost', True)
    # Open the directory chooser dialog
    folder_path = filedialog.askdirectory(title=title, mustexist=True) # mustexist=True helps validation
    root.destroy() # Close the hidden root window

    if folder_path: # askdirectory returns "" if cancelled
        print(f"  -> Selected: {folder_path}")
        return folder_path
    else:
        print("  -> Folder selection cancelled or failed.")
        return None

# --- parse_email_file function remains the same ---
def parse_email_file(file_path: str) -> Optional[Dict[str, Union[str, None]]]:
    filename = os.path.basename(file_path); body: Optional[str] = None; original_subject: Optional[str] = None
    annotation_0: Optional[str] = None; annotation_1: Optional[str] = None; annotation_2: Optional[str] = None
    metadata_part: str = ""; found_subject_tag: bool = False; seen_ann0: bool = False; seen_ann1: bool = False; seen_ann2: bool = False
    try:
        try:
            with open(file_path, 'r', encoding='utf-8', errors='ignore') as f: content = f.read()
        except: return None
        if not content.strip(): return None
        match = re.search(r"\n@(\w+)", content, re.MULTILINE)
        if match:
            first_marker_index = match.start(); raw_body = content[:first_marker_index].strip()
            if raw_body: body = raw_body
            metadata_part = content[first_marker_index:].strip()
        else:
            raw_body = content.strip();
            if raw_body: body = raw_body
            metadata_part = ""
        if metadata_part:
            metadata_regex = r"^@(\w+)\n(.*?)(?=\n@|\Z)"; metadata_matches = re.finditer(metadata_regex, metadata_part, re.MULTILINE | re.DOTALL)
            for m in metadata_matches:
                tag = m.group(1).strip().lower(); raw_value = m.group(2).strip()
                if tag == 'subject': found_subject_tag = True; original_subject = raw_value if raw_value else MISSING_PLACEHOLDER
                elif tag == 'ann0': seen_ann0 = True; annotation_0 = raw_value if raw_value else MISSING_PLACEHOLDER
                elif tag == 'ann1': seen_ann1 = True; annotation_1 = raw_value if raw_value else MISSING_PLACEHOLDER
                elif tag == 'ann2': seen_ann2 = True; annotation_2 = raw_value if raw_value else MISSING_PLACEHOLDER
        if body is None: body = MISSING_PLACEHOLDER
        if original_subject is None and not found_subject_tag: original_subject = MISSING_PLACEHOLDER
        parsed_data = {'filename': filename, 'body': body, 'subject': original_subject, 'annotation_0': annotation_0, 'annotation_1': annotation_1, 'annotation_2': annotation_2}
        return parsed_data
    except Exception as e: return None


# --- Main Execution ---
if __name__ == "__main__":
    print("\n--- Starting Data Preparation Script ---")
    print(f"This script will sample {NUM_FILES_TO_SAMPLE} files from the selected Train, Dev, and Test folders.")
    print("You will be prompted with folder selection dialogs.")

    # --- Get Folder Paths from User using GUI Dialog ---
    train_dir_selected = select_folder(title="Select TRAIN Data Folder")
    if train_dir_selected is None: sys.exit("Train folder selection cancelled. Exiting.")

    dev_dir_selected = select_folder(title="Select DEV Data Folder")
    if dev_dir_selected is None: sys.exit("Dev folder selection cancelled. Exiting.")

    test_dir_selected = select_folder(title="Select TEST Data Folder")
    if test_dir_selected is None: sys.exit("Test folder selection cancelled. Exiting.")

    output_dir_selected = select_folder(title="Select OUTPUT Folder (for CSV files)")
    if output_dir_selected is None: sys.exit("Output folder selection cancelled. Exiting.")


    # Assign validated paths
    TRAIN_DIR = train_dir_selected
    DEV_DIR = dev_dir_selected
    TEST_DIR = test_dir_selected
    OUTPUT_DIR = output_dir_selected

    print("\n--- All Paths Selected ---")
    print(f"Train Data Directory: {TRAIN_DIR}")
    print(f"Dev Data Directory: {DEV_DIR}")
    print(f"Test Data Directory: {TEST_DIR}")
    print(f"Output Directory: {OUTPUT_DIR}")
    print("-" * 20)

    run_timestamp = get_timestamp()
    print(f"Run Timestamp: {run_timestamp}")

    # Create output directory
    try:
        os.makedirs(OUTPUT_DIR, exist_ok=True)
        print(f"Output directory confirmed/created: {OUTPUT_DIR}")
    except OSError as e:
        print(f"FATAL ERROR: Could not create output directory {OUTPUT_DIR}: {e}. Exiting.", file=sys.stderr)
        sys.exit(1)

    splits_to_process = [
        ("train", TRAIN_DIR),
        ("dev", DEV_DIR),
        ("test", TEST_DIR)
    ]

    total_files_processed = 0
    total_files_skipped = 0

    # --- Process Sampled Files from Each Split ---
    # (The rest of the processing loop remains exactly the same as the previous version,
    #  using the TRAIN_DIR, DEV_DIR, TEST_DIR, OUTPUT_DIR variables which now hold
    #  the paths selected via the GUI dialog)
    for split_name, input_dir in splits_to_process:
        print(f"\n--- Processing Split: {split_name} ---")

        current_split_parsed_data: List[Dict] = []
        all_files_in_dir: List[str] = []
        split_skipped_count = 0
        sampled_filenames: List[str] = []
        actual_sample_size = 0

        try:
            all_files_in_dir = [f for f in os.listdir(input_dir)
                                if os.path.isfile(os.path.join(input_dir, f)) and f.lower().endswith(FILE_EXTENSION.lower())]
        except OSError as list_e:
            print(f"ERROR: Could not list files in directory {input_dir}: {list_e}. Skipping split.", file=sys.stderr)
            continue

        if not all_files_in_dir:
            print(f"Warning: No '{FILE_EXTENSION}' files found in {input_dir}. Skipping split.")
            continue

        actual_sample_size = min(NUM_FILES_TO_SAMPLE, len(all_files_in_dir))
        if actual_sample_size <= 0:
            print(f"Warning: No files available to sample in {input_dir} or sample size is zero. Skipping split.")
            continue

        try:
            sampled_filenames = random.sample(all_files_in_dir, actual_sample_size)
            print(f"Found {len(all_files_in_dir)} files. Randomly selected {len(sampled_filenames)} files for processing.")
        except ValueError as sample_e:
            print(f"ERROR: Error during random sampling for {split_name}: {sample_e}. Skipping split.", file=sys.stderr)
            continue

        print(f"Parsing selected files for '{split_name}' split...")
        for filename in tqdm(sampled_filenames, desc=f"Parsing {split_name} sample", unit="file"):
            file_path = os.path.join(input_dir, filename)
            parsed_result = parse_email_file(file_path)
            if parsed_result is not None:
                current_split_parsed_data.append(parsed_result)
            else:
                split_skipped_count += 1

        file_count = len(current_split_parsed_data)
        total_files_processed += file_count
        total_files_skipped += split_skipped_count
        print(f"Finished parsing sample for '{split_name}'. Successfully parsed: {file_count}, Skipped/Empty/Error: {split_skipped_count}")

        if not current_split_parsed_data:
            print(f"Warning: No data successfully parsed from the sample for split '{split_name}'. No CSV will be generated.")
            continue

        try:
            columns_order = ['filename', 'body', 'subject', 'annotation_0', 'annotation_1', 'annotation_2']
            df = pd.DataFrame(current_split_parsed_data, columns=columns_order)
        except Exception as df_e:
             print(f"ERROR: Could not create DataFrame for {split_name} sample: {df_e}. Skipping CSV save.", file=sys.stderr)
             continue

        output_csv_filename = f"{split_name}_sample_{actual_sample_size}_{run_timestamp}.csv"
        output_csv_path = os.path.join(OUTPUT_DIR, output_csv_filename)

        try:
            df.fillna('', inplace=True) # Replace None with empty string for CSV
            df.to_csv(output_csv_path, index=False, encoding='utf-8')
            print(f"Successfully saved {split_name} sample data ({len(df)} records) to: {output_csv_path}")
        except Exception as save_e:
            print(f"ERROR: Could not save {split_name} sample data to CSV {output_csv_path}: {save_e}. ", file=sys.stderr)


    print("\n--- Data Preparation Script Finished ---")
    print(f"Total files successfully parsed across all sampled splits: {total_files_processed}")
    print(f"Total files skipped (empty/error) within samples: {total_files_skipped}")